import React, { useState } from "react";
import Read from "./Read";
import Create from "./Create";

export default function App() {
  const [usersd, setusersd] = useState([]);
  const [lastid, setlastid] = useState(0);

  const onaddusers = (newUsers) => {
    setusersd(newUsers);
    setlastid(newUsers.length); // Update lastid based on the length of the users array
  };

  return (
    <>
      <Create lastid={lastid} onaddusers={onaddusers} />
      <Read users={usersd} />
      <h1>Hello Create</h1>
    </>
  );
}
